import React from 'react';

const FooterPlayer = ({ currentMusic }) => {
    return (
        <div className="footer-player">
            <div className="footer-music-info">
                <img src={currentMusic.cover} alt={currentMusic.title} />
                <div>
                    <h4>{currentMusic.title}</h4>
                    <p>{currentMusic.artist}</p>
                </div>
            </div>
            <div className="footer-controls">
                <button>⏮️</button>
                <button>⏸️</button>
                <button>⏭️</button>
            </div>
        </div>
    );
};

export default FooterPlayer;
